import React,{Component} from "react";
import Vote from "./Vote";
import './Mount.css'
class Mount extends Component
{  
    constructor(props)
    {

   super(props)

   this.state={
    'output':[],
      str:this.props.st


   }


}

componentDidMount()
{  

    if(this.state.str==="Traffic"||this.state.str==="traffic"||this.state.str==="Accident"||this.state.str==="accident"||this.state.str==="Hazard"||this.state.str==="hazard")
    {


     const url = "http://localhost:9000/incidents/findbyt/"+this.state.str;

     let headers=new Headers();
     headers.append('Content-Type','application/json');
     headers.append('Accept','application/json');
     headers.append('Access-control-Allow-origin',url);
     headers.append('Access-control-Allow-Credentials','true');
     headers.append('POST','GET');
     fetch(url, {
       headers: headers,
       method: 'GET',

     })


     .then(response => response.json()) 
     .then(response => this.setState({ 'output': response}))


     .catch(() => console.log("can't access " + url + " response. "))

    }


    else{

     const url = "http://localhost:9000/incidents/findbyl/"+this.state.str;

     let headers=new Headers();
     headers.append('Content-Type','application/json');
     headers.append('Accept','application/json');
     headers.append('Access-control-Allow-origin',url);
     headers.append('Access-control-Allow-Credentials','true');
     headers.append('POST','GET');
     fetch(url, {
       headers: headers,
       method: 'GET',

     })


       .then(response => response.json())
       .then(response => this.setState({ 'output' : response}))


       .catch(() => console.log("can't access" + url + "response. "))


    }
    //alert("No records")


}


render()
{
    return(
        <div>
         {  this.state.output.map(function(item){ 

    return (
        <div className='tab'>
        <table>
        <tbody>
          <tr>
         <th>Incident Id</th>
         <th> type</th>
         <th>subtype</th>
         <th> severityLevel</th>
         <th> damages</th>
         <th> location</th>
         <th> timeStamp</th>
         <th> additional Information</th>
         <th> upvote</th>
         <th> downvote</th>
         <th> report count</th>
         </tr>
         <React.Fragment key={item.incidentId}>
         <tr>
            <td>{item.incidentId}</td>
             <td>{item.incidentType}</td>
             <td>{item.subtype}</td>
           <td>{item.severityLevel}</td>
          <td>{item.damages}</td>
             <td>{item.location}</td>
             <td>{item.timeStamp}</td>
             <td>{item.addInfo}</td>
             <td>{item.upvote}</td>
             <td>{item.downvote}</td>
             <td>{item.reportCount}</td>

             <Vote id={item.incidentId} u={item.upvote} d={item.downvote} r={item.reportCount}/>
         </tr> 

</React.Fragment>
</tbody>
         </table>


        </div>


    )
})

    }
        </div>
    )
}
}

export default Mount;
